        primary key,
    ability_success_count int default 0 null,
    end_at                datetime(6)   null,
    game_code             varchar(255)  null,
    result                bit           null,
    start_at              datetime(6)   null,
    job_seq               bigint        not null,
    user_seq              bigint        not null,
    constraint FKk4a9l0v8xt6i9651ej21e0i6c
        foreign key (user_seq) references user (user_seq),
    constraint FKo5cwtoo2wyt8dkw8etv7qf3kx
        foreign key (job_seq) references job (job_seq)
);

